import ExpenseItem from './ExpenseItem'
import './Expenses.css'

function Expenses(props) {
  return (
    <div className="expenses">
      <ExpenseItem
      title={props.expenseItem[0].title}
      amount={props.expenseItem[0].amount}
      date={props.expenseItem[0].date}/>
    </div>
  );
}

export default Expenses
